import styled from 'styled-components';

export const InputContainer = styled.div `

width: auto;
height: auto;
align-items: center;
justify-content: flex-end;

display:flex;
margin-bottom: 6px;


    input {
    width: 100%;
    height: 110px;
    background-color: #09090A;
    border-radius: 20px;
    border: 0;
    text-align:end;
    padding: 0 12px ;
    color: #FAFAFA;
    letter-spacing: 1px;
font-size: 40px;

}

`
